import Link from "next/link";
import Layout from "../components/MyLayout.js";

export default function Game() {
  return (
    <Layout>
      <h1>Uno Game</h1>
      <Link href="/newgame">
        <a>Iniciar un nuevo Juego</a>
      </Link>
      <Link href="/joingame">
        <p>Unirse a un Juego</p>
      </Link>
    </Layout>
  );
}
